import axios from "axios"
import { URL_EMAIL_SEND_EMAIL } from "../utility/Endpoint"

export async function email(utente, tipo) {
  const oggetto = {
    utente,tipo
  }
  return await axios.post(URL_EMAIL_SEND_EMAIL,oggetto).then((response) => {
    alert(response);
  }).catch((error) => {
    console.log(error);
  });
}
